text:
Ada yang aneh dari setiap statmen kelompok jaringan ini dan sepertinya ada sesuatu yang hilang dari  jika IKN baru berada di titik sentral Indonesia. Ada apa ya...? Kehilangan apa ya...? Sepertinya ada sesuatu atau hal besar yg disembunyi kelompok jaringan orang2 ini. Dengan berbagai alasan dan stetmen untuk menggagalkan kinerja dan kerja pemerintahan negara yang ingin agar rakyatnya sejahtera bahkan berekonomi mapan serta  pola pikir yg maju dan kompeten.
Semoga tidak ada jaringan melompok mafia yang bertameng sesuatu dan sebagainya yang mencoba menggagalkan terlaksananya pembangun IKN dengan mengontaminasi manusia masyarakat awam agar tidak terjadi gejolak dan konflik berbasis SARA bahkan sebagai figur publik seoalah2 membela hak masyarakat adat setempat dlltetapi sebaliknya yg berpotensi fatal bagi kesatuan NKRI dan masyarakat rakyat Indonesia yang ingin maju.karena kita yakin dengan terlaksananya penyelenggaraan IKN ditempat baru (kalimantan), pasti memerlukan tenaga kerja baik ide pemikiran maupun tenaga baik dengan skill sesuai kriteria dibidangnya juga masyarakat bawah tanpa skill kerja harian lepas seperti kami ini untuk bersama menargetkan percepatan berdirinya IKN barus menggunakan alokasi Anggaran dana tercantum Terutama Warga keluarga Dayak sebagai penduduk original dan juga orang yang migrasi ke pulau ini. Selain itu juga putra putri Dayak berpotensi juga outomatis dipergunakan untuk mengisi lapangan kerja membantu kinerja percepatan pembangunan dan pengisian pembangunan baik yg berpontesi dengan skill yang mumpuni di bidangnya maupun kerja lepas harian seperti kami masyarakat bawah tanpa skill ini untuk mendongkrak dan mendorong lajunya proses kinerja pemerintah IKN baru untuk lebih maju dan pesat diberbagai bidang kedepan. Semoga dengan demikian NKRI dengan IKN baru dan jiwa baru serta semangat baru membawa seluruh lapisan masyarakat menjadi negara yg maju yang siap bersaing negara lain dalam bidang apapun. Jika hal itu terlihat dari kesejahteraan dan terpenuhinya kebutuhan pokok bahkan lainnya dengan teraerapnya tenaga kerja masyarakat setempat hingga minimnya pengangguran yg mengakibatkan potensi kemiskinan dan gejolak konflik serta kriminal.
Jika adanya pemerataan penerapan lapangan kerja dan penyerapan tenaga kerja sesuai dibidangnya baik dari multyskill hingga non-skill dan tidak mengenyangkan individu maupun kelompok tertentu. Bahkan yang hanya berusaha berseliweran dalam pergerakan mobilisasi bidang apapun dan hanya jadi pengawas, pengontrol dan memasukan ideologi kedalam sendi pergerarkan aktifitas mobilsasi segala bidang dalam pemerintahan (contohnya; seperti EDy Mulyadi, egi sujana, azam khan, ahmad khosinudin, djuju purwanto dkk serta jaringannya ini), dan yang akhirnya setelah mendapat kepercayaan dan mandat mengontrol penuh. Mereka hanya akan makan keringat orang lain dengan kata lain ongkang2 kaki dan mendapat "japre/jatah preman".

Karena biasanya jaringan seperti mereka ini sudah terbiasa makan kenyang tanpa melihat ke bawah yg duduk mengonggok kelaparan.
Apalagi kengerian dari cita2 mereka ingin membuat UUD, Pancasila, dan Bhineka tunggal ika, bukan lagi Republik Demokrasi dan demi nasib dan masa depan rakyat. Tapi harus tunduk dan satu warna yaitu ideologi mereka yang menaungi, hingga semua unsur dan sendi mobilisasi RI baik IKN lama maupun Baru harus dibawah kontrol mereka dan wajib memberi upeti kepada kerajaan (kelomopok ini) ini. 
Dan bahkan untuk menyokong orasi dan aktifitas ekstrem lainnya yg bakal mereka rencana dan lakukan kedepan.
